import { Route, Routes } from "react-router-dom";

import HomePage from "./Components/HomePage";
import AboutUs from "./Components/AboutUs";
const App = () => {
  return (
    <>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<AboutUs />} />
      </Routes>
    </>
  );
};
export default App;
